import "./HomePageCSS.css";
import { BsHeartFill, BsHeart } from "react-icons/bs";
import { BiCommentDetail } from "react-icons/bi";

const HomePage = () => {
  return (
    <div className="post">
      <div className="header-section">Rick</div>
      <div className="img-section">
        <img
          src="https://www.nme.com/wp-content/uploads/2022/10/Rick_And_Morty_Portal_Gun_JuRicksic_Mort.jpg"
          alt="Post Img"
        />
      </div>
      <div className="like-comment-section">
        <div className="like-comment">
          <BsHeart style={{ fontSize: "24px", cursor: "pointer" }} />
          <BiCommentDetail style={{ fontSize: "24px", cursor: "pointer" }} />
        </div>

      </div>
      <div className="comment-section"></div>
    </div>
  );
};

export default HomePage;
